import io from 'socket.io-client'
import Cookie from 'js-cookie'
/*export default class SockConn {
    constructor(){
        this.sock = io.connect()
    }
}*/
//let sock = io.connect('http://192.168.0.9:4000')
export default class SockConn {
    constructor() {
        this.user = Cookie.get('name')
        this.socket = io.connect('http://192.168.0.9:4000')
    }

    init(){
        this.socket.emit('init', this.user)
    }
}
